import React from 'react'
import useFormik from 'formik'
const Createuser = (props) => {
  const formik=useFormik({
    initialValues:{
      mothername:"",
      fathername:"",
      location:"",
      designation:"",
      city:"",
      age:""
    }
  })

  return (
    <div>
      <form>
        <label>Mothername</label>
        <input type="text" name="mothername"/>
        <label>Fathername</label>
      </form>
    </div>
  )
}

export default Createuser
